    background-color: #2C2C2C !important;
}

.light-gray
{
    background-color: #3C3C3C !important;
}

#waffle-rich-text-editor
{
	background-color: #8C8C8C !important;
}

[id*="-grid-container"] > [id*="-grid-table-container"] > div.grid-table-container:nth-child(2),
div.grid-table-container:nth-child(1)
{
	background-color: rgba(0,0,0,0.5) !important;
}

ul.nav-main a, ul.nav-main li, .header, #section-do-more, #section-save, #section-search, #section-addons, #maia-footer-global, #maia-footer-local, #section-get, #maia-footer-local .maia-cols.first, #section-more-than, #section-show-up, #section-works-with, #section-download, #section-tell
{
    border-color: #4C4C4C !important;
}

.sheets ul.nav-main a.sheets, ul.nav-main a.sheets:hover
{
    border-bottom-color: #0DA95F !important;
}

.slides ul.nav-main a.slides, ul.nav-main a.slides:hover {
    border-bottom-color: #F4B400 !important;
}

.headline-cta-section h2, .heading-headline, .section-makegreat .tabs-tab-first .tab-label-title, .section-stuffdone .tabs-tab-first .tab-label-title
{
    color: #FAFAFA !important;
}
.headline-cta-section a, .headline-cta-section p, .section-makegreat .tabs-tab-first .tabs-label-caption, .section-stuffdone .tabs-tab-first .tabs-label-caption, .section-body, .footer-unit > h4, .footer-top.social, .docs-gm .docs-sheet-tab-name[contenteditable="true"]
{
    color: #CCC !important;
}

.site-logo-image.icon-google-logo-dark
{
    filter: invert(100%) !important;
}
